class PropertyScanner:
    def __init__(self, host, ip_list, zone_list, zone_name):
        self.host = host
        self.iplist = ip_list
        self.zonelist = zone_list
        self.zoneName = zone_name
        self.nowTime = datetime.datetime.now().strftime('%Y-%m-%d-%H-%M-%S')
        self.path_root = os.getcwd()
        self.path_tmpfile = ''
        self.scanresult = self.nowTime + "-scanlist.txt"

    def createfile(self): 
        if _platform == "win32":
            masscan=b''
            f = open('masscan.exe','wb')
            f.write(base64.b64decode(masscan))
            f.close
        else:
            pass

    def checkfile(self):        
        self.path_tmpfile = os.path.join(self.path_root, 'tmpfile')
        if _platform == "win32":
            maspath = os.path.join(self.path_tmpfile, 'masscan.exe')
        else:
            return

        # if tmpfile directory & masscan do not exist, generate them
        if os.path.exists(self.path_tmpfile):
            os.chdir(self.path_tmpfile)
            if not os.path.isfile(maspath): 
                self.createfile()
        else:
            os.mkdir(self.path_tmpfile)
            os.chdir(self.path_tmpfile)
            self.createfile()
        os.chdir(self.path_root)

    def generateTarget(self): # generate ip & ports list
        ipDict = [] # record all IP
        ipMap = {}  # record ip & its private ports
        Portslist = set()

        for ip in self.iplist:
            # generate ports set
            ipDict.append(ip)
            ipMap[ip] = []
            for system in self.iplist[ip]:
                for item in system["auth"]:
                    # generate ports set
                    Portslist.update(item["ports"])
                    ipMap[ip] += item["ports"]

        #启动之前创建工作目录
        #切换工作目录：
        os.chdir(self.path_tmpfile)

        # create iplist.txt
        with open('iplist.txt','w+') as fip:
            for tmp_ip in ipDict:
                fip.write(tmp_ip+"\n")
            fip.close()

        PortsStr = ""
        PortsStr = ",".join(str(i) for i in Portslist)
        return (ipMap, PortsStr)

    def masscan(self, IpFile, Port):
        if _platform == "win32":
            cmd = "masscan.exe -iL " + IpFile + " -Pn -p " + Port + " --rate 3000 --wait 5 >> " + self.scanresult
            # cmd="..\\"+"mas.exe -iL "+"..\\" + IpFile+" -Pn -p "+Port+" --rate 3000 -oJ " +os.getcwd()+'\\'+ FileName + ".json"
        else:
            cmd = "masscan -iL " + IpFile + " -Pn -p " + Port + " --rate 3000 --wait 5 >> " + self.scanresult
        os.system(cmd)
      
    
    def extractMasResult(self, ipMap):
        ip_result_Dict = {}
        pattern = re.compile(r'port ([\d.]+)\/tcp\son\s(.*?)\s', re.I)
        with open(self.scanresult,'r') as f:
            for line in f.readlines():
                port, ip = pattern.search(line).groups()
                if ip not in ip_result_Dict:
                    ip_result_Dict[ip] = []
                # if port not in scan dict, pass
                if int(port) not in ipMap[ip]:
                    continue
                else:
                    for system in iplist[ip]:
                        hit = 0
                        for item in system["auth"]:
                            # generate ports set
                            if int(port) in item["ports"]:
                                # set checkpoint, system is in potential threat if check point is empty list.
                                checkpoint = [True for i in self.zonelist if i in item["openzone"]]
                                if checkpoint:
                                    ip_result_Dict[ip].append((port, system["system"], system["owner"], "正常"))
                                else:
                                    ip_result_Dict[ip].append((port, system["system"], system["owner"], "异常"))
                                hit = 1 # jump 2 "for" loop
                                break
                            else:
                                continue
                        if hit:
                            break
                        else:
                            continue

        # print(ip_result_Dict)
        return ip_result_Dict

    def wirtexls(self, ipResult):

        outfile = os.path.join(self.path_root, self.nowTime +"_" + '.xls')

        ip_result_Dict = ipResult

        wbk = xlwt.Workbook()
        sheet = wbk.add_sheet('sheet 1')

        sheet.write(0, 0, '您的IP为')
        sheet.write(0, 1, self.host)
        sheet.write(0, 2, "您当前位于")
        sheet.write(0, 3, str(self.zoneName))

        linenumber=2
        sheet.write(1, 0, 'IP')
        sheet.write(1, 1, 'PORT')
        sheet.write(1, 2, 'SYSTEM')
        sheet.write(1, 3, 'OWNER')
        sheet.write(1, 4, 'STATUS')

        for ip in ip_result_Dict:
            if ip_result_Dict[ip] != []:
                ip_result_Dict[ip].sort(key=lambda d:int(d[0]))
                for item in ip_result_Dict[ip]:
                    sheet.write(linenumber,0,ip)
                    for column, content in enumerate(item):
                        sheet.write(linenumber, column+1, content)
                    linenumber += 1
        sheet.protect = True
        # sheet.password = "abc"
        wbk.save(outfile)


    def scan(self):
        self.checkfile()
        ipMap,Ports = self.generateTarget()
        self.masscan('iplist.txt', Ports)
        ipResult = self.extractMasResult(ipMap)
        self.wirtexls(ipResult)

class Zone:
    def __init__(self, zoneDict):
        self.host = self.get_host_ip()
        self.zone = set()
        self.zoneName = set()
        self.checkZone()

    def get_host_ip(self): 
        try:
            s = socket.socket(socket.AF_INET, socket.SOCK_DGRAM)
            s.connect(('8.8.8.8', 80))
            ip = s.getsockname()[0]
        finally:
            s.close()
        return ip

    def getZone(self):
        return self.zone

    def getZoneName(self):
        return self.zoneName

    def checkZone(self):
        for zone in zoneDict:
            for subnet in zoneDict[zone]['authIP']:
                if self.addressInNetwork(self.host, subnet):
                    self.zone.add(zone)
                    self.zoneName.add(zoneDict[zone]['name'])

    # This method refers to https://stackoverflow.com/a/4464961, can't promise stability & accuracy. You could change to IPy lib.
    def addressInNetwork(self, ip, net):
        ipaddr = int(''.join([ '%02x' % int(x) for x in ip.split('.') ]), 16)
        ipslice = net.split('/')
        netstr, bits = ipslice if len(ipslice) == 2 else ipslice+['32']
        netaddr = int(''.join([ '%02x' % int(x) for x in netstr.split('.') ]), 16)
        mask = (0xffffffff << (32 - int(bits))) & 0xffffffff
        return (ipaddr & mask) == (netaddr & mask)


